import React, { Component, useEffect, useState} from 'react';
import {Container, Row, Col, Form, Button} from 'react-bootstrap';
import config from '../config.js';
import {Formik } from 'formik';
import * as yup from 'yup';
const firebase = require("firebase");
export default function Guestbook() {

  const [data, setData] = useState([])
  const [rend, setRend] = useState(true)

  const schema = yup.object({
    name: yup.string().required(),
    description: yup.string().notRequired(),
    message: yup.string().required(),
    view: yup.bool().required(),
    email: yup.string().notRequired()
  });

  useEffect(() => {
      if (!firebase.apps.length) {
         firebase.initializeApp(config)
      }

      let ref = firebase.database().ref('data');

      ref.on ('value', snapshot => {
        const state = snapshot.val()
        setData (state)
      })
  },[rend])

  return(
    <div>
      <Container fluid>
        <Row>
          <Col>
            <h1 className = "ml-3 mt-3"> Guestbook </h1>
          </Col>
        </Row>
        <Row>
          <Col>
            <Formik
              validationSchema={schema}
              onSubmit={console.log}
              initialValues={{
                name: "",
                description: "",
                message: "",
                view: "",
                email: ""

              }}
            >
              {({
                handleSubmit,
                handleChange,
                handleBlur,
                values,
                touched,
                isValid,
                errors,
              }) => (
                <Form noValidate onSubmit={handleSubmit}>
                  <Form.Row>
                    <Form.Group as={Col} md="4" controlId="formName">
                      <Form.Label>Name</Form.Label>
                      <Form.Control
                        type="text"
                        name="name"
                        value={values.name}
                        onChange={handleChange}
                        isValid={touched.name && !errors.name}
                      />
                    </Form.Group>
                  </Form.Row>
                  <Form.Row>
                    <Form.Group as={Col} md="4" controlId="formDescription">
                      <Form.Label>Description</Form.Label>
                      <Form.Control
                        type="text"
                        name="description"
                        value={values.description}
                        onChange={handleChange}
                        isValid={touched.description && !errors.description}
                      />
                    </Form.Group>
                  </Form.Row>
                  <Form.Row>
                    <Form.Group as={Col} md="4" controlId="formMessage">
                      <Form.Label>Message</Form.Label>
                      <Form.Control
                        type="text"
                        name="message"
                        value={values.message}
                        onChange={handleChange}
                        isValid={touched.message && !errors.message}
                      />
                    </Form.Group>
                  </Form.Row>

                  <Form.Row>
                    <Form.Group as={Col} md="4" controlId="formEmail">
                      <Form.Label>Email</Form.Label>
                      <Form.Control
                        type="text"
                        name="description"
                        value={values.email}
                        onChange={handleChange}
                        isValid={touched.email && !errors.email}
                      />
                    </Form.Group>
                  </Form.Row>


                  <Form.Row>
                    <Form.Group>
                      <Form.Check
                        required
                        name="view"
                        label="View for others"
                        onChange={handleChange}
                        isInvalid={!!errors.view}
                        id="formView"
                      />
                    </Form.Group>
                  </Form.Row>




                  <Button type="submit">Submit form</Button>
                </Form>
              )}
            </Formik>
          </Col>
        </Row>
        <Row className = "pt-3 pl-3 mr-md-0 mr-3 justify-content-md-center">
          {data}
        </Row>
      </Container>
    </div>
  )

}
